import React from "react";
import CourseRowComponent from "./CourseRowComponent";

class CourseListComponents extends React.Component{

    state = {
        courses: [
            {
                _id: "123",
                title: "CS5610",
                owner:"me",
                lastOpened:"yesterday"
            },
            {
                _id: "234",
                title: "CS4500",
                owner:"me",
                lastOpened:"yesterday"
            },
            {
                _id: "456",
                title: "CS4800",
                owner:"me",
                lastOpened:"yesterday"
            },
            {
                _id: "345",
                title: "CS3200",
                owner:"me",
                lastOpened:"yesterday"
            }
        ]
    }

    deleteCourse = (index) => {
        alert("delete course")
    }
    render(){
        return(
            <div>
                <h1>Course List(for {this.props.instructor}) {this.props.term}</h1>
                <table className="table">

                    {
                        this.state.courses.map((item, index) =>
                            <tr>
                                <td>{item.title}</td>
                                <td>
                                    <button
                                        onClick={this.deleteCourse}
                                        className="btn btn-danger">
                                        Delete
                                    </button>
                                </td>
                            </tr>
                        )
                    }
                </table>
            </div>
        );
    }
}

export default CourseListComponents;
